const Favorites = () => {
    const favorites = [{
        barbershop_
    }];

    return (
        <section className="favs">
            {favorites.length > 0 ? (
                favorites.map(e => (
                    <div key={e.id}>
                        <div></div>
                    </div>
                ))
            ) : (
                <div className="empthyFavs">
                    <h1>You haven't choose yet</h1>
                </div>
            )}
        </section>
    );
};

export default Favorites;
